import React from "react";
import { RouteComponentProps, useLocation } from "react-router";
import profilePic from "./images/profile/2602017071517530029820170521192154199Screenshot_2016-05-29-20-10-52_1.jpg";
import MoreVertIcon from "@material-ui/icons/MoreVert";
import SuperstarzIconLight from "./images/s.png";
import {
  useTheme,
  Paper,
  useMediaQuery,
  Grid,
  Typography,
  makeStyles,
  createMuiTheme,
  MuiThemeProvider,
} from "@material-ui/core";

interface stateType {
  userdata: { username: string; usercolor: string; userimage: string };
}

interface IappVariables {
  shade: string;
  shade2: string;
  shade2num: string;
  shade2nump: string;
  logoimage: string;
  secondarymaincolor: string;
  maincolor: string;
  shade2nump22: string;
}

var appVariables: IappVariables = {
  shade: "",
  shade2: "",
  shade2num: "",
  shade2nump: "",
  logoimage: "",
  secondarymaincolor: "",
  maincolor: "",
  shade2nump22: "",
};

var appVariablesDARK: IappVariables = {
  shade: "#cccccc",
  shade2: "#cccccc",
  shade2num: "1.1",
  shade2nump: "1.8",
  logoimage: SuperstarzIconDark,
  secondarymaincolor: "#ccccccff",
  maincolor: "#ccccccff",
  shade2nump22: "5.5",
};

var appVariablesLIGHT: IappVariables = {
  shade: "#0b111b",
  shade2: "#0b111b",
  shade2num: "1.5",
  shade2nump: "1.5",
  logoimage: SuperstarzIconLight,
  secondarymaincolor: "#0b111b",
  maincolor: "#0b111b",
  shade2nump22: "8",
};

if (darkmode) {
  appVariables = appVariablesDARK;
} else {
  appVariables = appVariablesLIGHT;
}

let themeGeneralSettings = createMuiTheme({
  palette: {
    primary: {
      main: `${appVariables.maincolor}`,
    },
    secondary: {
      main: `${appVariables.secondarymaincolor}`,
    },
    type: darkmode ? "dark" : "light",
  },
});

var useStyle = makeStyles((themeGeneralSettings) => ({
  AppPaperStyle: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      borderRadius: "0px",
      height: "100vh",
      textAlign: "center",
      backgroundImage: darkmode
        ? "linear-gradient(0deg, #282c34, #282c36, #191919 )"
        : "linear-gradient(0deg, rgb(222,225,225), rgb(238,237,239),rgb(250,250,255) )",
    },
  },
  PaperStyle: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      backgroundImage: darkmode
        ? "linear-gradient(0deg, #282c34, #282c36, #191919 )"
        : "linear-gradient(0deg, rgb(222,225,225), rgb(238,237,239),rgb(250,250,255) )",
    },
  },

  icon: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      objectFit: "contain",
      width: "86%",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      objectFit: "contain",
      width: "89%",
    },
    [themeGeneralSettings.breakpoints.up("md")]: {
      objectFit: "contain",
      width: "60%",
      transition: " 0.5s transform ease-in",
      cursor: "pointer",
    },
    "&:hover": {
      transition: "560ms transform ease-in",
      transform: "scale(1.06)",
    },
    "&:active": {
      transition: "200ms transform ease-in",
      transform: "scale(0.94)",
    },
  },

  superstarzText: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      fontFamily: "kaushan_scriptregular",
      fontSize: "2.9vh",
      fontWeight: "bolder",
      transition: "opacity 1.5s",
      opacity: textVisible ? "1" : "0",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      fontFamily: "kaushan_scriptregular",
      fontSize: "3.3vw",
      fontWeight: "bolder",
      transition: "opacity 1.5s",
      opacity: textVisible ? "1" : "0",
    },
    [themeGeneralSettings.breakpoints.up("md")]: {
      fontFamily: "kaushan_scriptregular",
      fontSize: "2.4vw",
      fontWeight: "bolder",
      transition: "opacity 1.5s",
      opacity: textVisible ? "1" : "0",
    },
  },

  littleText: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      fontSize: "1.7vh",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      fontSize: "2.1vw",
    },
    [themeGeneralSettings.breakpoints.up("md")]: {
      fontSize: "1.04vw",
    },
    transition: "opacity 1.5s",
    fontWeight: "normal",
    fontFamily: "kaushan_scriptregular",
    color: darkmode ? "#ccccccff" : "#0b111b",
    opacity: textVisible ? "1" : "0",
  },

  loginclass: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      fontSize: "1.7vh",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      fontSize: "1.9vw",
    },
    [themeGeneralSettings.breakpoints.up("md")]: {
      fontSize: "0.9vw",
    },
    padding: "8.5px",
    borderRadius: "50px",
    mozBoxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
    webkitBoxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
    boxShadow: `0 0 ${appVariables.shade2num}px ${appVariables.shade2} `,
  },

  signupclass: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      fontSize: "1.7vh",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      fontSize: "1.9vw",
    },
    [themeGeneralSettings.breakpoints.up("md")]: {
      fontSize: "0.9vw",
    },

    padding: "10.8px",
    borderRadius: "50px",
    mozBoxShadow: `0 0 4.5px ${appVariables.shade}`,
    webkitBoxShadow: `0 0 4.5px ${appVariables.shade} `,
    boxShadow: `0 0 4.5px ${appVariables.shade}`,
  },

  optionsContainer: {
    [themeGeneralSettings.breakpoints.up("xs")]: {
      padding: "3vh",
      top: "1em",
      fontWeight: "bold",
      display: "flex",
      alignItems: "center",
    },
    [themeGeneralSettings.breakpoints.up("sm")]: {
      padding: "4.5vh",
      top: "1em",
      fontWeight: "bold",
      display: "flex",
      alignItems: "center",
    },
  },
}));

var classes = useStyle();

function Supercheck() {
  const { state } = useLocation<stateType>();
  console.log(state.userdata);
  return (
    <MuiThemeProvider theme={themeGeneralSettings}>
      <Paper></Paper>
    </MuiThemeProvider>
  );
}

export default Supercheck;
